// SPDX-License-Identifier: MIT
pragma solidity ^0.7.0;

/**
 * SimpleTornado - A simplified version for testing without ZK proofs
 * WARNING: This is for testing only! It has no privacy!
 */
contract SimpleTornado {
    uint256 public denomination = 1000000 ether; // 1M PLS
    
    mapping(bytes32 => bool) public commitments;
    mapping(bytes32 => bool) public nullifierHashes;
    mapping(bytes32 => address) public deposits; // Maps commitment to depositor
    
    event Deposit(bytes32 indexed commitment, uint32 leafIndex, uint256 timestamp);
    event Withdrawal(address to, bytes32 nullifierHash);
    
    uint32 public depositCount = 0;
    
    function deposit(bytes32 _commitment) external payable {
        require(msg.value == denomination, "Incorrect deposit amount");
        require(!commitments[_commitment], "Commitment already exists");
        
        commitments[_commitment] = true;
        deposits[_commitment] = msg.sender;
        
        emit Deposit(_commitment, depositCount++, block.timestamp);
    }
    
    function withdraw(
        bytes32 _nullifierHash,
        bytes32 _commitment,
        address payable _recipient
    ) external {
        require(commitments[_commitment], "Invalid commitment");
        require(!nullifierHashes[_nullifierHash], "Note already spent");
        
        nullifierHashes[_nullifierHash] = true;
        
        (bool success, ) = _recipient.call{value: denomination}("");
        require(success, "Transfer failed");
        
        emit Withdrawal(_recipient, _nullifierHash);
    }
    
    function emergencyWithdraw(bytes32 _commitment, address payable _recipient) external {
        require(commitments[_commitment], "Invalid commitment");
        require(deposits[_commitment] == msg.sender, "Not your deposit");
        
        commitments[_commitment] = false;
        
        (bool success, ) = _recipient.call{value: denomination}("");
        require(success, "Transfer failed");
    }
}
